function getNearCharToCenter(radius)
    local arr = {}
    local sx, sy = getScreenResolution()
    for _, player in ipairs(getAllChars()) do
        if select(1, sampGetPlayerIdByCharHandle(player)) and isCharOnScreen(player) and player ~= playerPed then
            local plX, plY, plZ = getCharCoordinates(player)
            local cX, cY = convert3DCoordsToScreen(plX, plY, plZ)
            local distBetween2d = getDistanceBetweenCoords2d(sx / 2, sy / 2, cX, cY)
            if distBetween2d <= tonumber(radius and radius or sx) then
                table.insert(arr, {distBetween2d, player})
            end
        end
    end
    if #arr > 0 then
        table.sort(arr, function(a, b) return (a[1] < b[1]) end)
        return arr[1][2]
    end
    return nil
end

function camhack()
    local flymode = 0
	local fov = 70
    local radarHud = 0
    local keyPressed = 0
	local speed = 15.0
	
	zoom_posX, zoom_posY = 30, 220	
	
    while true do wait(0)
			local pStSet = sampGetServerSettingsPtr()
			if isCharInAnyCar(PLAYER_PED) and getCarModel(storeCarCharIsInNoSave(PLAYER_PED)) == 497 then
				local posX, posY, posZ = getCarModelCornersIn2d(getCarModel(storeCarCharIsInNoSave(PLAYER_PED)), storeCarCharIsInNoSave(PLAYER_PED))
				posZ = posZ + 0.5
				if not sampIsChatInputActive() and not sampIsDialogActive() and not active and testCheat("BC") then
					active, draw = true, true
					if flymode == 0 and active then
						-- posX, posY, posZ = getCharCoordinates(playerPed)
						angZ = getCharHeading(playerPed)
						angZ = angZ * -1.0
						setFixedCameraPosition(posX, posY, posZ, 0.0, 0.0, 0.0)
						angY = 0.0
						flymode = 1
					end
				end
	
				if flymode == 1 and not sampIsChatInputActive() and not isSampfuncsConsoleActive() then
					setFixedCameraPosition(posX, posY, posZ, 0.0, 0.0, 0.0)
					
					if isKeyJustPressed(VK_1) then
						draw = not draw
						InfVi, NightVi = false, false
						setNightVision(false)
						setInfraredVision(false)
					end
					if isKeyJustPressed(VK_2) then
						NightVi = not NightVi
						InfVi  = false
						setNightVision(NightVi)
						setInfraredVision(false)
					end
					if isKeyJustPressed(VK_3) then
						InfVi = not InfVi
						NightVi = false
						setNightVision(false)
						setInfraredVision(InfVi)
					end
					
					if isKeyDown(VK_OEM_PLUS) then
						speed = speed + 5.0
						printStringNow(speed, 1000)
					end
					
					if isKeyDown(VK_OEM_MINUS) then
						speed = speed - 5.0
						if speed <= 10.00 then
							speed = 10.00
						end
						printStringNow(speed, 1000)
					end
					
					local delta = getMousewheelDelta()
					if not isKeyDown(VK_SHIFT) then delta = delta else delta = delta / 2 end
					fov = fov - delta
					
					if fov >= 100 then fov = 100 end
					if fov <= 20 then fov = 20 end
					cameraSetLerpFov( fov,  fov, 700, true)
					
					renderDrawTexture(zoom, convertG(zoom_posX).x, convertG(zoom_posY).y, 220, 24, 0, 0xFAAAAAAA)
					renderDrawTexture(arrow, convertG(zoom_posX+82).x+(-(245 * fov) / 100), convertG(zoom_posY).y, 24, 20, 0, 0xFFFFFFFF)
					renderFontDrawTextAlign(my_font2, 'Zoom: '..fov..' Sensitivity: '..speed, convertG(zoom_posX+36).x, convertG(zoom_posY+10).y, '0xFFFFFFFF', 2)
					
					if active_car_view then
						local cx, cy, _ = getActiveCameraCoordinates()
						local px, py, _ = getActiveCameraPointAt()
						angZ = math.atan2( (px-cx), (py-cy) ) * 180 / math.pi
						if angZ <= 0 then angZ = 360 + angZ elseif angZ >= 0 then angZ = angZ end
						
						local positionX, positionY, positionZ = getCarCoordinates(car_view)
						angY = angleZ_test(positionX, positionY, positionZ)
						angY = -angY
					end
					
					if not active_car_view then
						offMouX, offMouY = getPcMouseMovement()
		
						offMouX = offMouX / speed
						offMouY = offMouY / speed
						angZ = angZ + offMouX
						angY = angY + offMouY
					
		
						if angZ > 360.0 then angZ = angZ - 360.0 end
						if angZ < 0.0 then angZ = angZ + 360.0 end
		
						if angY >= 4.7 then angY = 4.7 end
						if angY < -89.0 then angY = -89.0 end
		
						radZ = math.rad(angZ)
						radY = math.rad(angY)
						sinZ = math.sin(radZ)
						cosZ = math.cos(radZ)
						sinY = math.sin(radY)
						cosY = math.cos(radY)
						sinZ = sinZ * cosY
						cosZ = cosZ * cosY
						sinZ = sinZ * 1.0
						cosZ = cosZ * 1.0
						sinY = sinY * 1.0
						poiX = posX
						poiY = posY
						poiZ = posZ
						poiX = poiX + sinZ
						poiY = poiY + cosZ
						poiZ = poiZ + sinY
						-- print(poiX, poiY, poiZ)
						pointCameraAtPoint(poiX, poiY, poiZ, 2)
	
					end
	
				if keyPressed == 0 and isKeyDown(VK_F9) then
					keyPressed = 1
					if radarHud == 0 then
						displayHud(true)
						radarHud = 1
						-- memory.setint8(pStSet + 47, 1) -- показать хп
						-- memory.setint8(pStSet + 56, 1) -- показать ник
						-- sampSetChatDisplayMode(2)
						memory.setuint8(sampGetBase() + 0x71480, 0x74, true)
						-- memory.setint32(0xBA676C, 0) -- включить радар(для лаунчера аризоны)
					else
						displayHud(false)
						radarHud = 0 
						-- memory.setint8(pStSet + 47, 0) -- скрыть хп
						-- memory.setint8(pStSet + 56, 0)	-- скрыть ник
						memory.setuint8(sampGetBase() + 0x71480, 0xEB, true)
						-- memory.setint32(0xBA676C, 2) -- выключить радар(для лаунчера аризоны)
						-- sampSetChatDisplayMode(0)
					end
				end
	
	
				if wasKeyReleased(VK_F9) and keyPressed == 1 then
					keyPressed = 0
				end
	
					if not sampIsChatInputActive() and not sampIsDialogActive() and active and testCheat("BC") then
						active, draw = false, false
						if flymode == 1 and not active then
							angPlZ = angZ * -1.0
							restoreCameraJumpcut()
							setCameraBehindPlayer()
							setNightVision(false)
							setInfraredVision(false)
							cameraSetLerpFov( standard_fov,  standard_fov, 700, true)
							flymode = 0
							fov = standard_fov
						end
					end
				end
			else
				if active then
					active, draw, active_car_view = false, false, false
					if flymode == 1 and not active then
						angPlZ = angZ * -1.0
						restoreCameraJumpcut()
						setCameraBehindPlayer()
						fov = standard_fov
						flymode = 0
						setNightVision(false)
						setInfraredVision(false)
						cameraSetLerpFov( standard_fov,  standard_fov, 700, true)
					end
				end
			end
    end
end


function compass()

	heli_posX, heli_posY = 25, 150
	
	camera1_posX, camera1_posY = 75, 165
	
	arrow_compass_posX, arrow_compass_posY = 72, 133
	
	compass_text_posX, compass_text_posY = 320, 25.5

	while true do wait(0)
		if active and isCharInAnyCar(PLAYER_PED) and getCarModel(storeCarCharIsInNoSave(PLAYER_PED)) == 497 then
			local cx, cy, _ = getActiveCameraCoordinates()
			local px, py, _ = getActiveCameraPointAt()
			local camDirection = math.round((math.atan2( (px-cx), (py-cy) ) * 180 / math.pi), 0)
			if camDirection <= 0 then camDirection = 360 + camDirection elseif camDirection >= 0 then camDirection = camDirection end
			
			local finalText, yaw = "", -camDirection
			
			for i = yaw - 120, yaw + 120 do
				local y = i if i >= 180 then y = -360 + i elseif i <= -180 then y = 360 + i end
				finalText = (compassText[y] and compassText[y]..finalText) or " "..finalText
			end
			number = 0
			for k, v in ipairs(split(finalText, ' '), true) do
				if v ~= '' then
					number = number + 1
					test3 = number == 3 and 1 or number == 2 and 0.7 or number == 1 and 0.5 or number == 4 and 0.7 or number == 5 and 0.5 or number == 6 and 0.4
					renderFontDrawTextAlign(my_font2, v..'', convertG(compass_text_posX).x+((-119+k)*2), convertG(compass_text_posY).y, '0x'..dectohex(test3)..'FFFFFF', 2)
					renderFontDrawTextAlign(my_font, '|', convertG(compass_text_posX).x+((-119+k)*2), convertG(compass_text_posY-10.5).y, '0x'..dectohex(test3)..'FFFFFF', 2)
					
					if number >= 2 then
					renderFontDrawTextAlign(my_font2, '|', convertG(compass_text_posX-43).x+((-119+k)*2), convertG(compass_text_posY-10.5).y, '0x'..dectohex(test3)..'FFFFFF', 2)
					end
					if number <= 4 then
					renderFontDrawTextAlign(my_font2, '|', convertG(compass_text_posX+45).x+((-119+k)*2), convertG(compass_text_posY-10.5).y, '0x'..dectohex(test3)..'FFFFFF', 2)
					end
				end
			
			end
			
			renderDrawTexture(arrow, convertG(316).x, convertG(14).y, 24, 20, 0, 0xFAFFFFFF)
			
			local ang_vheli = getCarHeading(storeCarCharIsInNoSave(PLAYER_PED))
			renderDrawTexture(heli, convertG(heli_posX).x, convertG(heli_posY).y, 128, 128, 0, 0xFAFFFFFF)
			renderDrawTexture(konus, convertG(heli_posX-1).x, convertG(heli_posY-20).y, 128, 128, ang_vheli + camDirection, 0xFAFFFFFF)
			renderFontDrawTextAlign(my_font2, math.round(ang_vheli, 0), convertG(heli_posX+21.5).x, convertG(heli_posY+6).y, '0xFFFFFFFF', 2)
			renderFontDrawTextAlign(my_font2, (tostring(-camDirection)):gsub('-', ''), convertG(heli_posX+21.5).x, convertG(heli_posY+13).y, '0xFFFFFFFF', 2)
			
			renderDrawTexture(camera1, convertG(camera1_posX).x, convertG(camera1_posY).y, 74, 74, 0, 0xFAFFFFFF)
			renderDrawTexture(konus, convertG(camera1_posX).x, convertG(camera1_posY-8).y, 74, 128, 90-angY, 0xdaFFFFFF)
			renderFontDrawTextAlign(my_font2, (tostring(math.round(angY, 0))):gsub('-', ''), convertG(camera1_posX+25).x, convertG(camera1_posY+10).y, '0xFFFFFFFF', 2)
			
			renderDrawTexture(arrow_compass, convertG(arrow_compass_posX).x, convertG(arrow_compass_posY).y, 90, 90, ang_vheli, 0xFAFAFAFA)
			renderDrawTexture(compass_stat, convertG(arrow_compass_posX+10).x, convertG(arrow_compass_posY+14).y, 30, 30, 0, 0xDAFFFFFF)
			
			renderDrawTexture(viewfinder, convertG(253.5).x, convertG(164).y, 400, 289, 0, 0xFaFFFFFF)
			
		end
	end
end


