function getCarModelCornersIn2d(id, handle)-- https://www.blast.hk/threads/13380/post-925354 by chapo
    local x1, y1, z1, x2, y2, z2 = getModelDimensions(id)
    local t = {
        [1] = {getOffsetFromCarInWorldCoords(handle, x1         , y1 * -1.1, z1)},
        [2] = {getOffsetFromCarInWorldCoords(handle, x1 * -1.0  , y1       , z1)},
    }
	local xc = (t[1][1] + t[2][1])/ 2
	local yc = (t[1][2] + t[2][2])/ 2
	local zc = (t[1][3] + t[2][3])/ 2
    return xc, yc, zc
end

function fixed_camera_to_skin() -- проверка на приклепление камеры к скину
	return (memory.read(getModuleHandle('gta_sa.exe') + 0x76F053, 1, false) >= 1 and true or false)
end

function dectohex(input)
	return (string.format("%x", input * 255)) -- "7F"
end

function split(str, delim, plain) -- https://www.blast.hk/threads/13380/post-231049
    local tokens, pos, plain = {}, 1, not (plain == false) --[[ delimiter is plain text by default ]]
    repeat
        local npos, epos = string.find(str, delim, pos, plain)
        table.insert(tokens, string.sub(str, pos, npos and npos - 1))
        pos = epos and epos + 1
    until not pos
    return tokens
end

function renderFontDrawTextAutoAlign(font, text, x, y, color)
    local sw, sh = getScreenResolution()
    if x <= sw/3 then renderFontDrawText(font, text, x, y, color)
    elseif x <= sw/1.5 then renderFontDrawText(font, text, x - renderGetFontDrawTextLength(font, text) / 2, y, color)
    else renderFontDrawText(font, text, x - renderGetFontDrawTextLength(font, text), y, color)
    end
end

function renderFontDrawTextAlign(font, text, x, y, color, align)
    if not align or align == 1 then -- слева
        renderFontDrawText(font, text, x, y, color)
    end
    if align == 2 then -- по центру
        renderFontDrawText(font, text, x - renderGetFontDrawTextLength(font, text) / 2, y, color)
    end
    if align == 3 then -- справа
        renderFontDrawText(font, text, x - (renderGetFontDrawTextLength(font, text , true)/2), y - renderGetFontDrawHeight(font), color)
    end
    if align == 4 then -- справа
        renderFontDrawText(font, text, x - renderGetFontDrawTextLength(font, text), y, color)
    end
end

function math.round(num, idp)
	local mult = 10^(idp or 0)
	return math.floor(num * mult + 0.5) / mult
end

function convertG(xy)
	local gposX, gposY = convertGameScreenCoordsToWindowScreenCoords(xy, xy)
	local cGtbl = {['x'] = gposX, ['y'] = gposY}
	return cGtbl
end

function convertW(xy)
	local wposX, wposY = convertWindowScreenCoordsToGameScreenCoords(xy, xy)
	local cWtbl = {['x'] = wposX, ['y'] = wposY}
	return cWtbl
end

function onScriptTerminate(LuaScript, quitGame)
    if LuaScript == thisScript() and not quitGame then
		if active then
			setNightVision(false)
			setInfraredVision(false)
			restoreCameraJumpcut()
			setCameraBehindPlayer()
